import React, {useState} from "react"

const App = () => {

  const [input, setInput] = useState("")
  const [toDo, setToDo] = useState([])

  return (
  <div className="container">
    <div className="app-wrapper">
      <div>
        <Header />
        <Form 
        input = {input}
        setInput = {setInput}
        toDo = {toDo}
        setToDo = {setToDo}
        />
      </div>
      <div>
        <toDoList />
      </div>
    </div>
  </div>

  )
}

export default App
